void CMonsterParameterTable::Clear()
{
	if( m_spriteName.size() != 0 )
		m_spriteName.clear();

	if( m_mobName.size() != 0 )
		m_mobName.clear();
}


std::pair<bool,std::string> CMonsterParameterTable::SetTable(const int in_Job, const std::string in_SpriteName, const std::string in_Name)
{
	m_spriteName[in_SpriteName.c_str()] = in_Job;

	if( in_Name.size() != 0 )
		m_mobName[in_Name.c_str()] = in_Job;

	return std::pair<bool,std::string>(true, "good");
}


int CMonsterParameterTable_SetTable(lua_State* L)
{
	if( !lua_isnumber(L, -3) )
	{
		lua_pushboolean(L, FALSE);
		lua_pushstring(L, MakeFormatString("argment 1st is must number").c_str());
		return 2;
	}

	if( !lua_isstring(L, -2) )
	{
		lua_pushboolean(L, FALSE);
		lua_pushstring(L, MakeFormatString("argment 2nd is must string").c_str());
		return 2;
	}

	if( !lua_isstring(L, -1) && lua_type(L, -1) != LUA_TNIL )
	{
		lua_pushboolean(L, FALSE);
		lua_pushstring(L, MakeFormatString("argment 3rd is must string or nil").c_str());
		return 2;
	}

	const int Job = (int)lua_tonumber(L, -3);
	const char* pSpriteName = lua_tolstring(L, -2, NULL);
	const char* pName = ( lua_type(L, -1) != LUA_TNIL ) ? lua_tolstring(L, -1, NULL) : "";

	std::pair<bool,std::string> ret = g_monParameter.CMonsterParameterTable::SetTable(Job, pSpriteName, pName);
	lua_pushboolean(L, ret.first);
	lua_pushstring(L, ret.second.c_str());
	return 2;
}


namespace {
bool SetTableFromLuaFile()
{
	NLuaState LuaState;
	if( !LuaState.NLuaState::isOK() )
		return false;

	luaL_openlibs(LuaState);

	lua_pushcclosure(LuaState, &CMonsterParameterTable_SetTable, 0);
	lua_setfield(LuaState, LUA_GLOBALSINDEX, "settable");

	if( luaL_loadfile(LuaState, "NPCIdentitySvr.lua") != 0 )
	{
		MessageBoxA(NULL, lua_tolstring(LuaState, -1, NULL), __FUNCTION__, MB_OK);
		return false;
	}

	if( lua_pcall(LuaState, 0, 0, 0) != 0 )
	{
		MessageBoxA(NULL, lua_tolstring(LuaState, -1, NULL), __FUNCTION__, MB_OK);
		return false;
	}

	lua_getfield(LuaState, LUA_GLOBALSINDEX, "main");
	if( lua_pcall(LuaState, 0, 2, 0) != 0 )
	{
		MessageBoxA(NULL, lua_tolstring(LuaState, -1, NULL), __FUNCTION__, MB_OK);
		return false;
	}

	if( !lua_isstring(LuaState, -1) )
	{
		MessageBoxA(NULL, "second return value is not string...", __FUNCTION__, MB_OK);
		return false;
	}

	if( !lua_toboolean(LuaState, -2) )
	{
		std::string msg = std::string() + "error found unknown :" + lua_tolstring(LuaState, -1, NULL);
		MessageBoxA(NULL, msg.c_str(), __FUNCTION__, MB_OK);
		return false;
	}

	return true;
}
}; // namespace


void CMonsterParameterTable::SetTable()
{
	for( int i = 0; g_mobTable[i].name != NULL; ++i )
	{
		m_spriteName[g_mobTable[i].name] = g_mobTable[i].num;
	}

	for( int i = 0; g_mobTable2[i].name1 != NULL; ++i )
	{
		m_mobName[g_mobTable2[i].name1] = g_mobTable2[i].num;
		m_spriteName[g_mobTable2[i].name2] = g_mobTable2[i].num;
	}

	if( !SetTableFromLuaFile() )
	{
		MessageBoxA(NULL, "check NPCIdentity.lua file and NPCIdentitySvr.lua file", __FUNCTION__, MB_OK);
		exit(EXIT_SUCCESS);
	}
}


void CMonsterParameterTable::SaveToFileMobName(const char* fName)
{
	FILE* fp = fopen(fName, "w");
	if( fp == NULL )
		return;

	for( std::map<std::string,unsigned long>::iterator iter = m_mobName.begin(); iter != m_mobName.end(); ++iter ) //NOTE: wrong container in official code
		fprintf(fp, "%s %d\n", iter->first.c_str(), iter->second);

	fclose(fp);
}


void CMonsterParameterTable::SaveToFileNpcSpr(const char* fName)
{
	FILE* fp = fopen(fName, "w");
	if( fp == NULL )
		return;

	for( std::map<std::string,unsigned long>::iterator iter = m_spriteName.begin(); iter != m_spriteName.end(); ++iter )
		fprintf(fp, "%s %d\n", iter->first.c_str(), iter->second);

	fclose(fp);
}
